import React from "react";
import RoadmapImg from '../../assets/roadmap.jpg'
import './style.css'

function Roadmap() {
  return (
    <>
    <div className="mpl-box-md">
      <div className="container">
        <h2 className="display-2 mb-60 text-center">
          Roadmap
        </h2>
    <div className="mpl-footer mpl-footer-parallax mpl-footer-social">
      <div className="mpl-image" data-speed="0.9" data-img-position="100% 0%">
        <img src={RoadmapImg} alt="" className="jarallax-img" />
      </div>
      
    </div>
    </div>
    </div>
    </>
  );
}

export default Roadmap;
